import React, { Component } from "react"
import { Grid, Cell } from "react-mdl"

class Education extends Component {
    
    render() {
        return(
            <Grid>
                <Cell col={4}>
                    <p>{this.props.startYear} - {this.props.endYear}</p>
                </Cell>

                <Cell col={8}>
                    <h4 style={{marginTop: "0px"}}>{this.props.schoolName}</h4>
                    <p>{this.genList(this.props.relevantClasses)}</p>
                    const SimpleList = ({ this.prop.relevantClasses }) => (
                        <ul>
                            {this.prop.relevantClasses.map(item => (
                                <li key={item}>{item}</li>
                            ))}
                        </ul>
                    );
                    <ul>
                        <li>A</li>
                        <li>B</li>
                        <li>C</li>
                        <li>D</li>
                        <li>E</li>
                    </ul>
                </Cell>
            </Grid>
        )
    }
}

export default Education
